import React from "react";
import Home from "./Home";

class Content extends React.Component {

    // activePanel(props){
    //     return(
    //         <div>
    //             <a>asd</a>
    //         </div>
    //     )
    // }

    render(){
        const actp=this.state.activePanel;
        let button;
        if(actp=="home"){
            button=<Home/>;
        }
        else{
            button=<a>asd</a>
        }
        return(
            <div>
                {button}
            </div>
        );
    }
}

export default Content;
